import React from 'react';
import {NavLink} from "react-router-dom";
import './header.css';

const Header = () => {
  return (
    <div class = "header">
      <NavLink activeStyle={{color: 'white', textDecoration: 'none'}}  to='/page1'>Page1</NavLink>
      <NavLink activeStyle={{color: 'white'}} to='/page2'>Page2</NavLink>
    </div>
  )
}

export default Header;
